function deleteMovie(id, event) {
    event.stopPropagation(); // Prevent modal from opening
    if (confirm("Are you sure you want to delete this movie?")) {
        movies = movies.filter(m => m.id !== id);
        
        // Remove from LocalStorage
        let uploadedMovies = JSON.parse(localStorage.getItem('uploadedMovies')) || [];
        uploadedMovies = uploadedMovies.filter(m => m.id !== id);
        localStorage.setItem('uploadedMovies', JSON.stringify(uploadedMovies));

        // Persist deletion across refresh for any movie id
        let deletedIds = JSON.parse(localStorage.getItem('deletedIds')) || [];
        if (!deletedIds.includes(id)) {
            deletedIds.push(id);
            localStorage.setItem('deletedIds', JSON.stringify(deletedIds));
        }

        displayMovies(movies);
        alert("Movie deleted successfully!");
    }
}

function editMovie(id, event) {
    event.stopPropagation();
    const movie = movies.find(m => m.id === id);
    if (!movie) return;

    // Populate form
    document.getElementById('movieTitle').value = movie.title;
    document.getElementById('movieCategory').value = movie.category;
    document.getElementById('movieDescription').value = movie.description;
    document.getElementById('movieVideo').value = movie.video;
    
    // Set edit mode
    isEditing = true;
    editingId = id;
    
    // Change button text
    const btn = movieUploadForm.querySelector('button[type="submit"]');
    btn.innerHTML = '<i class="fas fa-sync"></i> Update Movie';
    
    // Show upload section if hidden
    uploadSection.style.display = 'block';
    
    // Scroll to form
    uploadSection.scrollIntoView({ behavior: 'smooth' });
}

// UPLOAD / UPDATE MOVIE
function handleMovieUpload() {
    const title = document.getElementById('movieTitle').value;
    const category = document.getElementById('movieCategory').value;
    const description = document.getElementById('movieDescription').value;
    const video = document.getElementById('movieVideo').value;
    const episodesRaw = document.getElementById('movieEpisodes') ? document.getElementById('movieEpisodes').value : '';
    const posterFile = document.getElementById('moviePoster').files[0];

    const escapeVal = (s) => {
        if (s == null) return "";
        return String(s).replace(/\\/g, "\\\\").replace(/"/g, '\\"').replace(/\n/g, "\\n");
    };
    const buildCode = (m) => {
        const fields = [
            `id: ${m.id}`,
            `title: "${escapeVal(m.title)}"`,
            `description: "${escapeVal(m.description)}"`,
            `duration: "${escapeVal(m.duration)}"`,
            `views: "${escapeVal(m.views)}"`,
            `poster: "${m.poster}"`,
            `category: "${escapeVal(m.category)}"`,
            `video: "${escapeVal(m.video)}"`
        ];
        let ep = "";
        if (Array.isArray(m.episodes) && m.episodes.length > 0) {
            const eps = m.episodes.map(e => `        { title: "${escapeVal(e.title)}", video: "${escapeVal(e.video)}" }`).join(',\n');
            ep = `,\n    episodes: [\n${eps}\n    ]`;
        }
        return `{\n    ${fields.join(',\n    ')}${ep}\n}`;
    };

    const saveAndReset = (movieData) => {
        let uploadedMovies = JSON.parse(localStorage.getItem('uploadedMovies')) || [];

        if (isEditing) {
            // Remove old version from localStorage if exists
            uploadedMovies = uploadedMovies.filter(m => m.id !== editingId);
            // Add updated version
            uploadedMovies.unshift(movieData);
            
            // Update in local memory
            const idx = movies.findIndex(m => m.id === editingId);
            if (idx !== -1) movies[idx] = movieData;

            alert("Movie updated successfully!");
        } else {
            uploadedMovies.unshift(movieData);
            movies.unshift(movieData);
            alert("Movie uploaded successfully!");
        }

        localStorage.setItem('uploadedMovies', JSON.stringify(uploadedMovies));
        displayMovies(movies);

        // Reset Form
        document.getElementById('movieUploadForm').reset();
        isEditing = false;
        editingId = null;
        const btn = movieUploadForm.querySelector('button[type="submit"]');
        btn.innerHTML = '<i class="fas fa-upload"></i> Upload Movie';
        try {
            const shareJson = JSON.stringify(movieData);
            const b64 = btoa(unescape(encodeURIComponent(shareJson)));
            const link = `${location.origin}${location.pathname}?addMovie=${encodeURIComponent(b64)}`;
            alert(`Share this link so others can add the movie:\n${link}`);
        } catch(e){}
        const sec = document.getElementById('generatedCodeSection');
        const out = document.getElementById('generatedCode');
        if (sec && out) {
            out.value = buildCode(movieData);
            sec.style.display = 'block';
        }
        const copyBtn = document.getElementById('copyCodeBtn');
        if (copyBtn && out) {
            copyBtn.onclick = () => {
                navigator.clipboard.writeText(out.value).then(() => { alert("Code copied"); }).catch(() => {});
            };
        }
    };

    if (isEditing && !posterFile) {
        // Keep existing poster
        const existing = movies.find(m => m.id === editingId);
        const updated = { ...existing, title, category, description, video };
        saveAndReset(updated);
    } else {
        if (!posterFile) {
            alert("Please select a poster image.");
            return;
        }
        // Convert image
        const reader = new FileReader();
        reader.onloadend = function() {
            const base64Poster = reader.result;
            const newId = isEditing ? editingId : Date.now();
            
            const movieData = {
                id: newId,
                title, description, category, 
                duration: "Unknown", 
                views: "0",
                poster: base64Poster, video
            };
            const lines = (episodesRaw || '').split('\n').map(s=>s.trim()).filter(Boolean);
            if(lines.length > 0) {
                movieData.episodes = lines.map((u, i) => ({ title: `Episode ${i+1}`, video: u }));
            }
            saveAndReset(movieData);
        }
        reader.readAsDataURL(posterFile);
    }
}

function updateVisitorStats() {
    const visitEl = document.getElementById('statTotalVisits');
    if(visitEl) {
        fetch(`https://api.countapi.xyz/hit/${COUNTAPI_NS}/total_visits`).then(r=>r.json()).then(d=>{
            if(d && d.value!=null) visitEl.textContent = d.value;
        }).catch(()=>{});
    }
    const liveEl = document.getElementById('statLiveUsers');
    if(liveEl) {
        fetch(`https://api.countapi.xyz/hit/${COUNTAPI_NS}/online_users`).then(r=>r.json()).then(d=>{
            if(d && d.value!=null) liveEl.textContent = d.value;
        }).catch(()=>{});
        const poll = () => {
            fetch(`https://api.countapi.xyz/get/${COUNTAPI_NS}/online_users`).then(r=>r.json()).then(d=>{
                if(d && d.value!=null) liveEl.textContent = d.value;
            }).catch(()=>{});
        };
        setInterval(poll, 5000);
        window.addEventListener('beforeunload', async () => {
            try {
                const cur = await fetch(`https://api.countapi.xyz/get/${COUNTAPI_NS}/online_users`).then(r=>r.json());
                if(cur && cur.value!=null) {
                    const v = Math.max(0, cur.value-1);
                    await fetch(`https://api.countapi.xyz/set/${COUNTAPI_NS}/online_users?value=${v}`);
                }
            } catch(e){}
        });
        document.addEventListener('visibilitychange', async () => {
            try {
                if(document.visibilityState === 'hidden') {
                    const cur = await fetch(`https://api.countapi.xyz/get/${COUNTAPI_NS}/online_users`).then(r=>r.json());
                    if(cur && cur.value!=null) {
                        const v = Math.max(0, cur.value-1);
                        await fetch(`https://api.countapi.xyz/set/${COUNTAPI_NS}/online_users?value=${v}`);
                    }
                } else {
                    const d = await fetch(`https://api.countapi.xyz/hit/${COUNTAPI_NS}/online_users`).then(r=>r.json());
                    if(d && d.value!=null) liveEl.textContent = d.value;
                }
            } catch(e){}
        });
    }
    const viewsEl = document.getElementById('statTotalViews');
    if(viewsEl) {
        fetch(`https://api.countapi.xyz/get/${COUNTAPI_NS}/total_views`).then(r=>r.json()).then(d=>{
            if(d && d.value!=null) viewsEl.textContent = d.value;
        }).catch(()=>{});
        setInterval(() => {
            fetch(`https://api.countapi.xyz/get/${COUNTAPI_NS}/total_views`).then(r=>r.json()).then(d=>{
                if(d && d.value!=null) viewsEl.textContent = d.value;
            }).catch(()=>{});
        }, 5000);
    }
    const moviesEl = document.getElementById('statTotalMovies');
    if(moviesEl) moviesEl.textContent = movies.length;
}

function renderViewsChart() {
    const el = document.getElementById('viewsChart');
    if(!el || !window.Chart) return;
    const fetches = movies.map(m => fetch(`https://api.countapi.xyz/get/${COUNTAPI_NS}/movie_${m.id}_views`).then(r=>r.json()).then(d=>({movie:m, count:(d&&d.value!=null)?d.value:0})).catch(()=>({movie:m, count:0})));
    Promise.all(fetches).then(items => {
        items.sort((a,b)=>b.count-a.count);
        const top = items.slice(0,5);
        const labels = top.map(x=>x.movie.title);
        const data = top.map(x=>x.count);
        if(viewsChartInstance) { viewsChartInstance.destroy(); }
        viewsChartInstance = new Chart(el.getContext('2d'), {
            type: 'bar',
            data: { labels, datasets: [{ label: 'Views', data, backgroundColor: '#e50914' }] },
            options: { responsive: true, plugins: { legend: { display: false } }, scales: { y: { beginAtZero: true } } }
        });
    });
}

function renderEpisodeList(movie, activeIndex) {
    const el = document.getElementById('episodeList');
    if(!el) return;
    el.style.display = 'block';
    el.dataset.active = String(activeIndex);
    const items = movie.episodes.map((ep, i) => {
        const a = i === activeIndex ? '#e50914' : '#fff';
        const b = i === activeIndex ? '#333' : '#222';
        return `<button data-index="${i}" style="display:block;width:100%;text-align:left;margin:5px 0;padding:10px;border:1px solid #333;border-radius:8px;background:${b};color:${a};cursor:pointer">Episode ${i+1}</button>`;
    }).join('');
    el.innerHTML = items;
    el.querySelectorAll('button[data-index]').forEach(btn=>{
        btn.addEventListener('click', (e)=>{
            const idx = parseInt(btn.getAttribute('data-index'));
            renderEpisodeList(movie, idx);
            playEpisode(movie, idx);
        });
    });
}

function playEpisode(movie, index) {
    const ep = movie.episodes[index];
    const url = getEmbedUrl(ep.video);
    if (ep.video.match(/\.(mp4|webm|ogg)$/i)) {
        videoContainer.innerHTML = `
            <video id="moviePlayer" controls autoplay style="position: absolute; top: 0; left: 0; width: 100%; height: 100%; border-radius: 20px 20px 0 0;">
                <source src="${ep.video}" type="video/mp4">
                Your browser does not support the video tag.
            </video>
        `;
        const v = document.getElementById('moviePlayer');
        const errEl = document.getElementById('playbackError');
        if(errEl) errEl.style.display = 'none';
        if(v) v.addEventListener('error', () => showPlaybackError(ep.video));
    } else {
        videoContainer.innerHTML = `
            <iframe 
                src="${url}" 
                style="position: absolute; top: 0; left: 0; width: 100%; height: 100%; border-radius: 20px 20px 0 0;"
                frameborder="0" 
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" 
                allowfullscreen>
            </iframe>
        `;
        const errEl = document.getElementById('playbackError');
        if(errEl) errEl.style.display = 'none';
        const ifr = videoContainer.querySelector('iframe');
        let loaded = false;
        if(ifr) {
            ifr.addEventListener('load', () => { loaded = true; });
            setTimeout(() => { if(!loaded) showPlaybackError(ep.video); }, 4000);
        }
    }
    movieModal.style.display = 'block';
    fetch(`https://api.countapi.xyz/hit/${COUNTAPI_NS}/total_views`).then(r=>r.json()).then(d=>{
        const viewsEl = document.getElementById('statTotalViews');
        if(viewsEl && d && d.value!=null) viewsEl.textContent = d.value;
    }).catch(()=>{});
    fetch(`https://api.countapi.xyz/hit/${COUNTAPI_NS}/movie_${movie.id}_views`).then(r=>r.json()).then(d=>{
        const card = document.querySelector(`.movie-card[data-id="${movie.id}"]`);
        const badge = card ? card.querySelector('.views-badge') : null;
        if(badge && d && d.value!=null) badge.innerHTML = `<i class="fas fa-eye"></i> ${d.value}`;
    }).catch(()=>{});
    fetch(`https://api.countapi.xyz/hit/${COUNTAPI_NS}/movie_${movie.id}_ep_${index}_views`).catch(()=>{});
    if(isAdmin) renderViewsChart();
}

// EVENTS
function setupEventListeners() {
    if(adminBtn) adminBtn.addEventListener('click', (e) => {
        e.preventDefault(); // Prevent scrolling to top
        toggleAdminMode();
    });
    // Category card clicks -> open category page (same index with query)
    if (categoryCards && categoryCards.length) {
        categoryCards.forEach(card => {
            card.addEventListener('click', () => {
                const cat = card.dataset.category;
                if (!cat) return;
                const url = `${location.origin}${location.pathname}?category=${encodeURIComponent(cat)}`;
                location.href = url;
            });
        });
    }
    // Footer category links (#hollywood etc.) -> redirect to query param page
    document.querySelectorAll('a[href^="#"]').forEach(a => {
        const hash = (a.getAttribute('href') || '').replace('#','').toLowerCase();
        if (['hollywood','bollywood','netflix','action','comedy','drama'].includes(hash)) {
            a.addEventListener('click', (e) => {
                e.preventDefault();
                const url = `${location.origin}${location.pathname}?category=${encodeURIComponent(hash)}`;
                location.href = url;
            });
        }
    });
    window.addEventListener('keydown', (e) => {
        if(e.key && e.key.toLowerCase() === 'g') {
            e.preventDefault();
            toggleAdminMode();
        }
    });

    // Form Submit
    movieUploadForm.addEventListener('submit', e => {
        e.preventDefault();
        handleMovieUpload();
    });

    // Modal Close (X button)
    document.querySelector('.close').addEventListener('click', closeMovieModal);
    
    // Modal Close (Click Outside)
    window.addEventListener('click', (e) => {
        if (e.target === movieModal) {
            closeMovieModal();
        }
    });
    
    // Subscribe Button
    const subBtn = document.querySelector('.subscribe-btn');
    if(subBtn) {
        subBtn.addEventListener('click', () => {
            alert("Thank you for subscribing! You will get updates.");
            subBtn.innerHTML = '<i class="fas fa-check"></i> Subscribed';
            subBtn.style.background = '#28a745';
        });
    }
}

// SCROLL ANIMATION
function setupScrollAnimations() {
    observer = new IntersectionObserver(entries => {
        entries.forEach(entry => {
            if (entry.isIntersecting) {
                entry.target.classList.add('visible');
            }
        });
    }, { threshold: 0.1 });
}
